// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface System {
    function versionCheck()
        external 
        returns(uint);

    function errorCheck()
        external 
        returns(bool);

    function boot()
        external 
        returns(uint, bool);
}

contract Cumputer is System {
    function versionCheck()
        public 
        pure 
        override 
        returns(uint) {
            return 3;
        }

    function errorCheck()
        public 
        pure 
        override 
        returns(bool) {
            return true;
        }

    function boot()
        public 
        pure 
        override 
        returns(uint, bool) {
            return (versionCheck(), errorCheck());
        }
}

contract SmartPhone is System {
    function versionCheck()
        public 
        pure 
        override 
        returns(uint) {
            return 25;
        }

    function errorCheck()
        public 
        pure 
        override 
        returns(bool) {
            return true;
        }

    function boot()
        public 
        pure 
        override 
        returns(uint, bool) {
            return (versionCheck(), errorCheck());
        }
}

